import Navigation from './Navigation';
import Head from 'next/head';

const Container = (props) => {
  return (
    <>
      <Head>
        <title>{props.title}</title>
      </Head>
      <Navigation />
      <div>
        {props.children}
      </div>
    </>
  );
};

export default Container;
